import React from 'react';
import '../styles/Style.css';
import { GitHub, LinkedIn } from '@mui/icons-material';




const Hero = () => {
    return (
        <>
            <div className='hero'>
                <section className='text-section'>
                    <h1 style={{ fontWeight: "800", fontSize: "50px" }}>Front-End React Developer</h1>
                    <p className=''>Hi, I'm Siddharth, a passionate Front-end React Developer based in Mumbai</p>
                    <a href='https://www.linkedin.com/in/siddharth-rupwate' style={{ color: "black" }}><LinkedIn /></a><a href='https://github.com/sidrupwate' style={{ color: "black" }}><GitHub /></a>

                </section>
                <section className='image-section'>
                    <img height={400} width={360} src='https://camo.githubusercontent.com/97d0c0c4209208d8ec9573c7e213e05872a9f59b703868647b559b77af601cc6/68747470733a2f2f692e70696e696d672e636f6d2f6f726967696e616c732f65382f66342f35332f65386634353334363961336563393765636433353464663436356437333931332e676966' />
                </section>
            </div>
        </>
    )
}

export default Hero
